// frontend/src/pages/UnderDevelopment.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';

function UnderDevelopment() {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-white text-center px-4">
      <div className="max-w-md">
        {/* Hardhat Icon SVG */}
        <svg className="mx-auto h-24 w-24 text-blue-600" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor">
          <path d="M21.92,8.62a1,1,0,0,0-.54-.54A1,1,0,0,0,21,8H17.5a1,1,0,0,1,0-2H21a3,3,0,0,1,3,3v5a1,1,0,0,1-1,1H1a1,1,0,0,1-1-1V11a3,3,0,0,1,3-3H6.5a1,1,0,0,1,0,2H3a1,1,0,0,0-1,1v5a1,1,0,0,0,0,2H22a1,1,0,0,0,0-2V11A1,1,0,0,0,21.92,8.62Z" />
          <path d="M12,2a8,8,0,0,0-8,8,1,1,0,0,0,2,0,6,6,0,0,1,12,0,1,1,0,0,0,2,0A8,8,0,0,0,12,2Z" />
          <path d="M12,12.5a4.1,4.1,0,0,0-3.5,2,1,1,0,0,0,1.74,1,2.1,2.1,0,0,1,3.52,0,1,1,0,0,0,1.74-1A4.1,4.1,0,0,0,12,12.5Z" />
        </svg>

        <h1 className="text-3xl font-bold text-gray-900 mt-6 mb-2">
          Feature Under Development
        </h1>
        <p className="text-gray-600 mb-8">
         WE ARE WORKING ON THIS FEATURE BE
        </p>
        <div className="flex flex-col sm:flex-row gap-4 justify-center">
          <button
            onClick={() => navigate(-1)}
            className="w-full bg-blue-600 text-white font-bold py-3 px-6 rounded-lg hover:bg-blue-700 transition-colors"
          >
            Go Back
          </button>
          <button
            onClick={() => navigate('/')}
            className="w-full bg-white text-blue-600 font-bold py-3 px-6 rounded-lg border-2 border-blue-600 hover:bg-blue-50 transition-colors"
          >
            Go to Home
          </button>
        </div>
      </div>
    </div>
  );
}

export default UnderDevelopment;
